import React, { Component } from 'react';

class  DetailCellRenderer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      image: props.data.image,
      barcode: props.data.barcode,
      price: props.data.price
    }

  }

  render() {
    return (
      <div style={{height: 200,margin:20,padding: 20,display: 'flex',flexDirection: 'row',justifyContent: 'space-between',alignItems: 'center',backgroundColor: 'yellow',borderRadius: 8}}>
        <div>
          <h1>صورة المنتج</h1>
        <h6>{this.state.image}</h6>
        </div>
        <div>
          <h1>الباركود</h1>
        <h3>{this.state.barcode}</h3>
        </div>
        <div>
          <h1>السعر</h1>
        <h3>{this.state.price}</h3>
        </div>
      </div>
    );
  }

}

export default DetailCellRenderer;
